```const Discord = require('discord.js')


module.exports = {
  nombre: 'ticket',
  alias: 'soporte',

  run: async (client, message, args) => {
    let everyone = message.guild.roles.cache.find(rol => rol.name == "@everyone");

    let e = message.guild.channels.cache.find(canal => canal.name == `Ticket ${message.author.username}`)
    if(e) return message.channel.send("**No puedes crear el ticket, Ya tienes otro ticket abierto.**")

    const razon = args.join(" ")
    if(!razon) return message.channel.send("__**Debes escribir una razón..**__")

    const embed = new Discord.MessageEmbed()

    .setTitle("__Ticket solicitado__")
    .setDescription(`__**${message.author.tag} Bienvenid@ a su ticket**__ \n Motivo del ticket: **${razon}** \n El equipo de soporte estará contigo en breve \nPara cerrar este ticket reacciona con :lock:`)
    .setTimestamp()
    .setColor("RANDOM")

    message.guild.channels.create(`Ticket ${message.author.username}`, {
      permissionOverwrites: [
        {
          id: everyone.id,
          deny: ["VIEW_CHANNEL", "SEND_MESSAGES"]
        },

        {
          id: message.author.id,
          allow: ["VIEW_CHANNEL", "SEND_MESSAGES"]
        }
      ],
      parent: "842190754046017566"
    }).then((c) => c.send(embed)).then((msg) => {
      msg.react(":lock:")

      msg.awaitReactions((reaction, user) => {
        if(message.author.id !== user.id) return;
        if(reaction.emoji.name === ':lock:'){
          msg.channel.delete()
        }
      })
    })

    message.channel.send("**Ticket creado correctamente..**")
  }
}```
